class SearchBar extends Component {

  searchHandler = (e) =>{
    console.log(e.target.value)
    this.props.changeHandler
  }


  render() {
    return(
      <div>
        <input placeholder="Search" onChange={this.searchHandler}/>
      </div>
    )
  }
}


export default SearchBar
